import React from "react"

function TodoItem(props) {
    return (
        <li>
            <input 
                type="checkbox"
                checked={props.item.completed}
                onChange={() => props.handleChange}
            />
            <label>
                {props.item}
            </label>
            <button className="todo-delete fas fa-trash-alt"></button>
        </li>
    )
}

export default TodoItem
